/// Status : true
/// StatusCode : 0
/// Message : "Topup Requester details loaded sucessfully.."
/// ReturnData : [{"TopupReqID":12,"ReqName":"Jayanthi  (RE-0006)","ReqAmt":200,"Wallet":0,"ReqDate":"2023-01-18T16:01:10.95","RequestStatus":"Waiting for Approved","BankName":"","ProofImage":"","Remarks":"demo"}]

class TopupReportResponse {
  TopupReportResponse(
    this.status,
    this.statusCode,
    this.message,
    this.reportData,
  );

  TopupReportResponse.fromJson(dynamic json) {
    status = json['Status'];
    statusCode = json['StatusCode'];
    message = json['Message'];
    if (json['ReturnData'] != null) {
      reportData = [];
      json['ReturnData'].forEach((v) {
        reportData.add(TopupReportData.fromJson(v));
      });
    }
  }

  late bool status;
  late int statusCode;
  late String message;
  late List<TopupReportData> reportData;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['Status'] = status;
    map['StatusCode'] = statusCode;
    map['Message'] = message;
    if (reportData != null) {
      map['ReturnData'] = reportData.map((v) => v.toJson()).toList();
    }
    return map;
  }
}

